    return (
        <ProductWrapper>
            <ProductPageItem {...ProductOne} />
            <ProductPageItem {...ProductTwo} />
            <ProductPageItem {...ProductTheree} />
            <ProductPageItem {...ProductFour} />
            <ProductPageItem {...ProductFive} />
        </ProductWrapper>
    )
}

export default ProductPageList
